import {BrowserRouter, Routes, Route} from 'react-router-dom'
import * as React from 'react';
import Home from './pages/Home/Home'
import Tab1 from './pages/Tab 1/Tab1';
import Tab3 from './pages/Tab 3/Tab3';
import { Info } from './controller/info'
import CssBaseline from '@mui/material/CssBaseline';
import IconButton from '@mui/material/IconButton';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import { useTheme, ThemeProvider, createTheme } from '@mui/material/styles';
import Brightness4Icon from '@mui/icons-material/Brightness4';
import Brightness7Icon from '@mui/icons-material/Brightness7';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import HomeIcon from '@mui/icons-material/Home';
import SearchIcon from '@mui/icons-material/Search';
import CompareArrowsIcon from '@mui/icons-material/CompareArrows';
import {useNavigate} from 'react-router-dom';
import { Context } from './controller/info';

const ColorModeContext = React.createContext({ toggleColorMode: () => {} });

function Header() {
  const theme = useTheme();
  const colorMode = React.useContext(ColorModeContext);
  const navigate = useNavigate()
  const user = React.useContext(Context)

  return (
    <Box sx = {{
      paddingBottom : '10%',
    }}>
      <AppBar sx = {{
        bgcolor: 'background.default',
        paddingTop: '0.2%',
        paddingBottom: '0.2%',
        paddingLeft : '2%',
        paddingRight : '2%',
        display: 'flex',
        alignItems:'stretch' ,
        flexDirection: 'row',
        justifyContent: 'space-between'
      }}>
        <Box>
          <List sx={{ flexGrow: 1, display: 'flex', flexDirection: 'row' }}>
            <ListItem disablePadding>
              <ListItemButton sx={{ textAlign: 'center' }} onClick={() => {
                navigate('../',{relative: 'path'})
              }}>
                <HomeIcon></HomeIcon>
                <ListItemText primary = {'Home'} sx={{ marginLeft: '16px', marginTop :'5px' }} />
              </ListItemButton>
              <ListItemButton sx={{ textAlign: 'center' }} onClick={() => {
                user.updateData([])
                navigate('../Tab1',{relative: 'path'})
              }}>
                <SearchIcon></SearchIcon>
                <ListItemText primary = {'Search'} sx={{ marginLeft: '16px', marginTop :'5px' }} />
              </ListItemButton>
              <ListItemButton sx={{ textAlign: 'center' }} onClick={() => {
                user.updateData([])
                navigate('../Tab3',{relative: 'path'})
              }}>
                <CompareArrowsIcon></CompareArrowsIcon>
                <ListItemText primary = {'Compare'} sx={{ marginLeft: '16px', marginTop :'5px' }} />
              </ListItemButton>
            </ListItem>
          </List>
        </Box>
          <IconButton sx={{ ml: 1, display: 'flex', justifyContent: 'center', marginLeft :'0', }} onClick={colorMode.toggleColorMode} color="inherit">
            {theme.palette.mode === 'dark' ? <Brightness7Icon /> : <Brightness4Icon />}
          </IconButton>
      </AppBar>
    </Box>
  );
}

export default function App() {
  const [mode, setMode] = React.useState('light');
  const colorMode = React.useMemo(
    () => ({
      toggleColorMode: () => {
        setMode((prevMode) => (prevMode === 'light' ? 'dark' : 'light'));
      },
    }),
    [],
  );

  const theme = React.useMemo(
    () =>
      createTheme({
        palette: {
          mode,
          primary: {
            main: '#81d4fa',
          },
          error: {
            main : '#e53935',
          }
        },
      }),
    [mode],
  );
  return (
    <Info>
      <ColorModeContext.Provider value={colorMode}>
        <ThemeProvider theme={theme}>
          <CssBaseline />
          <div>
            <BrowserRouter>
            <Header />
              <Routes>
                <Route path="/" element={<Home/>}/>
                <Route path="/tab1" element={<Tab1/>}/>
                <Route path="/tab3" element={<Tab3/>}/>
                <Route path="*" element={null} />
              </Routes>
            </BrowserRouter>
          </div>
        </ThemeProvider>
      </ColorModeContext.Provider>
    </Info>
  );
}
